import React, { useEffect, useState } from "react";
import "./style.css";
const Navbar = () => {
  const [user, setUser] = useState([]);

  const getUser = async () => {
    const response = await fetch("https://jsonplaceholder.typicode.com/posts");
    setUser(await response.json());
  };

  useEffect(() => {
    getUser();
  }, []);
  return (
    <>
      <div className="main-div">
        <section className="section-div ">
          <div className="first-s-div">
            Hi reader.
            <img src="" alt="" />
            <span className="f-s-d-s">Here's Your News!</span>
          </div>
          <div className="second-s-div">
            <h3>View Toggel</h3>
            <button className="s-s-d-button">
              <img src="\images\horizontal_split.svg" alt="" />
            </button>
            <button className="s-s-d-button">
              <img src="\images\vertical_split.svg" alt="" />
            </button>
          </div>

          <div className="third-s-div">
            Have a Feedback?
            <button className="t-s-d-button">
              <span>We're Listening!</span>
            </button>
          </div>
        </section>
        {/* <div className="news-div">
                <div className="news-c-div">
                <div className="img-div"><img src="\images\close.svg" alt="" /></div> 
                 <h1>helo</h1>
                 <p>pre</p>
                 </div>
                 </div>  */}
                 <div class="card" style="width: 18rem;">
  <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <h6 class="card-subtitle mb-2 text-muted">Card subtitle</h6>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" class="card-link">Card link</a>
    <a href="#" class="card-link">Another link</a>
  </div>
</div>
        
      </div>
    </>
  );
};

export default Navbar;
